  input: TEXT,SA11A1,SA11A1.36128,"On 2/24/05 we received a contribution from Donald
    Shuel in the amount of $20,000 which was deposited into our federal account.  Ten
    thousand dollars was transferred to our non-federal account on 2/28/05, which
    can accept unlimited contributions from individuals.  A letter was sent to Donald
    Shuel on the date his check was received to advise him of how his deposit was
    split into our accounts and to offer him a chance for a refund.  According to
    AO-2001-17, the Commission has deemed it sufficient to deposit checks exceeding
    the federal limits into a federal account and then to make a transfer to the non-federal
    for the portion that exceeds the federal limit.  Therefore, the year-to-date aggregate
    totals reported by Donald Shuel on our report is a reflection of the federal portion
    of the donor's contributions to date."
